const keypad = [
	[0, 0, 1, 0, 0],
    [0, 2, 3, 4, 0],
	[5, 6, 7, 8, 9],
	[0, "A", "B", "C", 0],
	[0, 0, "D", 0, 0],
];

testpath = `ULL
RRDDD
LURDL
UUUUD
`;
path = `




`;
// const path = [
// 	[ "U", "L", "L" ],
// 	[ "R", "R", "D", "D", "D" ],
// 	[ "L", "U", "R", "D", "L" ],
// 	[ "U", "U", "U", "U", "D" ],
// ];

const startpos = { x: 0, y: 2 };


let pos = Object.assign({}, startpos);
// console.log("Starting on:", keypad[pos.y][pos.x]);
path.split("").forEach((move) => {
	const lpos = Object.assign({}, pos);
	switch(move) {
		case "U":
			pos.y -= 1;
			break;
		case "R":
			pos.x += 1;
			break;
		case "D":
			pos.y += 1;
			break;
		case "L":
			pos.x -= 1;
			break;
		case String.fromCharCode(10):
			console.log("\t*", pos, keypad[pos.y][pos.x]);
			break;
	}
	if (pos.x > 4 || pos.x < 0 || pos.y > 4 || pos.y < 0 || keypad[pos.y][pos.x] === 0) { pos = Object.assign({}, lpos); }

});